// import logo from './logo.svg';
// import './App.css';
const Title =()=><h1>Resume</h1>
const Description =()=><p>รายงานประวัติส่วนตัว</p>

const Transaction =()=>{
  return (
    <ul>
      <li>ภาณุเดช แสงวิเศษ</li>
      <li>การาวิน ยินดี</li>
      <li>จีรายุ แสงอาวุธ</li>
    </ul>
  )
}

function App() {
  return (
    <div>
     <Title/>
     <Description/>
     <Transaction/>
    </div>

  );
}

export default App;
